func (ifs *InventoryFlowSelect) sqlScan(ctx context.Context, v interface{}) error {
	for _, f := range ifs.fields {
		if !inventoryflow.ValidColumn(f) {
			return &ValidationError{Name: f, err: fmt.Errorf("invalid field %q for selection", f)}
		}
	}
	rows := &sql.Rows{}
	query, args := ifs.sqlQuery().Query()
	if err := ifs.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (ifs *InventoryFlowSelect) sqlQuery() sql.Querier {
	selector := ifs.sql
	selector.Select(selector.Columns(ifs.fields...)...)
	return selector
}
